(function main() {

    var Plot = {
        id: 'plot',
        imgId: 'hover-image',
        domain: 'https://plot.ly'
    };

    Plot.iframe = document.getElementById(Plot.id);
    Plot.graphContentWindow = Plot.iframe.contentWindow;

    Plot.hoverImg = document.getElementById(Plot.imgId);

    Plot.init = function init() {
        var pinger = setInterval(function() {
            Plot.post({task: 'ping'});
        }, 500);

        function messageListener(e) {
            var message = e.data;

            if(message.pong) {
                console.log('Initial pong, frame is ready to receive');
                clearInterval(pinger);

                Plot.post({
                    'task': 'listen',
                    'events': ['hover']
                });
            }
            else if(message.type === 'hover') {
                Plot.onHover(message);
            }
        }

        window.removeEventListener('message', messageListener);
        window.addEventListener('message', messageListener);
    };

    Plot.post = function post(o) {
        Plot.graphContentWindow.postMessage(o, Plot.domain);
    };

    var artistToUrl = {
       'year-2016': 'data:image/jpeg;base64,',
           'year-2005': 'data:image/jpeg;base64,',
           'year-2006': 'data:image/jpeg;base64,',
           'year-2007': 'data:image/jpeg;base64,',
           'year-2008': 'data:image/jpeg;base64,',
           'year-2009': 'data:image/jpeg;base64,',
           'year-2010': 'data:image/jpeg;base64,',
           'year-2011': 'data:image/jpeg;base64,',
           'year-2012': 'data:image/jpeg;base64,',
           'year-2013': 'data:image/jpeg;base64,',
           'year-2014': 'data:image/jpeg;base64,',
           'year-2015': 'data:image/jpeg;base64,',
        };

    var blankImg = 'data:image/gif;base64,R0lGODlhAQABAAD/ACwAAAAAAQABAAACADs=';

    Plot.onHover = function(message) {
        var artist = message.points[0].x
            .toLowerCase()
            .replace(/ /g, '-');

        var imgSrc = blankImg;

        if(artistToUrl[artist] !== undefined) imgSrc = artistToUrl[artist];

        Plot.hoverImg.src = imgSrc;
    };

    Plot.init();

    })();
    